import './index.css';
import './App.css';
import React from 'react';
import FilteredList from './FilteredList.js';
import ListItem from './ListItem.jsx';

export default class App extends React.Component {
  render() {
    const artDict = [
      { name: "Harold Parker Forest", src: "/images/Piece1.jpg", medium: "oil paint", date: "08/2017", awards: "" },
      { name: "Black Cloud", src: "/images/Piece2.jpg", medium: "colored pencil", date: "3/2016", awards: "Scholastic Art and Writing Awards National Gold Medal" },
      { name: "Serenity", src: "/images/Piece3.jpg", medium: "watercolor", date: "05/2018", awards: "" },
      { name: "Frosted Pink", src: "/images/Piece4.jpg", medium: "colored pencil", date: "02/2014", awards: "" },
      { name: "The Unexpected Adventure", src: "/images/Piece5.jpg", medium: "colored pencil", date: "11/2015", awards: "" },
      { name: "Offstage", src: "/images/Piece6.jpg", medium: "colored pencil", date: "08/2016", awards: "Scholastic Art and Writing Awards Regional Silver Medal" },
      { name: "Flash of Life", src: "/images/Piece7.jpg", medium: "colored pencil", date: "09/2017", awards: "" },
      { name: "Red", src: "/images/Piece8.jpg", medium: "ink", date: "12/2016", awards: "" },
      { name: "*Untitled*", src: "/images/Piece9.jpg", medium: "collage", date: "10/2019", awards: "" },
      { name: "Moving Forward", src: "/images/Piece10.jpg", medium: "oil paint", date: "6/2016", awards: "" },
      { name: "Autumn Farmhouse", src: "/images/Piece11.jpg", medium: "oil paint", date: "7/2016", awards: "" },
      { name: "Cornucopia", src: "/images/Piece12.jpg", medium: "Mixed Media", date: "10/2016", awards: "Scholastic Art and Writing Awards Regional Gold Medal" }
    ];
    const artList = artDict.map((piece) =>
      <ListItem name={artDict.name} src={artDict.src} medium={artDict.medium} date={artDict.date} award={artDict.award} />);
    return <div><FilteredList list={artList} /></div>
  }
}
